import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Todolist from './component/todoList/todoList';
import CompleteList from './component/completeList/completeList';
import TodoManageList from './component/todoManageList/todoManageList'
//import todo from './component/todoList';
class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      newTodo: '',
      todos: [
        {
          text: 'Assignment',
          isComplete: false
        },
        {
          text: 'Nothing to do',
          isComplete: false
        },
        {
          text: 'Registration for new semister',
          isComplete: false
        },
        {
          text: 'Buy daily items from new market',
          isComplete: false
        }
      ]
    };
  }
  renderTodos() {
    return this.state.todos.map((todo, index) => (
      <div>
          <Todolist 
            key={index}
            index={index}
            text={todo.text} 
            checked={todo.isComplete}/>


      </div>
    )).reverse();

        {this.renderTodos()}
  }
  render() {
    return (
      <div>
        <TodoManageList/>
        <CompleteList/>
        {this.renderTodos()}
      </div>
    );
  }
}

